import React, { useState } from 'react';

const Navbar = () => {
  const [showMenu, setShowMenu] = useState(false);

  const toggleMenu = () => {
    setShowMenu(!showMenu);
  };

  return (
    <nav className="bg-grayLight text-tdgreen w-screen px-4">
      <div className="container mx-auto flex justify-between items-center py-4">
        <div className="text-xl font-bold text-tdgreen">Logo</div>
        <div className={`hidden md:flex space-x-4 ${showMenu ? 'flex' : 'hidden'}`}>
          <a href="/" className="text-tdgreen hover:text-gray-800">Workouts</a>
          <a href="/addWorkout" className="text-tdgreen hover:text-gray-800">Add Workout</a>
        </div>
        <div className="block md:hidden" onClick={toggleMenu}>
          <div className={`w-6 h-px bg-tdgreen mb-1 ${showMenu ? 'transform rotate-45' : ''}`}></div>
          <div className={`w-6 h-px bg-tdgreen mb-1 ${showMenu ? 'opacity-0' : ''}`}></div>
          <div className={`w-6 h-px bg-tdgreen mb-1 ${showMenu ? 'transform -rotate-45' : ''}`}></div>
        </div>
      </div>
      <div className={`md:hidden ${showMenu ? 'block' : 'hidden'} text-center`}>
        <a href="/" className="block px-4 py-2 text-white">Workouts</a>
        <a href="/addWorkout" className="block px-4 py-2 text-white">Add Workout</a>
      </div>
    </nav>
  );
};

export default Navbar;
